                        <span className="required-span">{fnameError}</span>
                      </Form.Group>
                      <Form.Group
                        as={Col}
                        md="4"
                        controlId="validationCustom02"
                      >
                        <Form.Label>
                          Last name<span className="required-span">*</span>
                        </Form.Label>
                        <Form.Control
                          required
                          type="text"
                          placeholder="Last name"
                          onChange={(e) => setLname(e.target.value)}
                        />
                        <span className="required-span">{lnameError}</span>
                      </Form.Group>
                      <Form.Group
                        as={Col}
                        md="4"
                        controlId="validationCustom01"
                      >
                        <Form.Label>
                          Mobile no.<span className="required-span">*</span>
                        </Form.Label>
                        <Form.Control
                          required
                          type="text"
                          placeholder="Enter 10 digit valid mobile no."
                          maxLength={10}
                          value={mobile}
                          onChange={(e) => mobileValidation(e.target.value)}
                        />
                        <span className="required-span">{mobileError}</span>
                      </Form.Group>
                    </Row>
                    <Row>
                      <Form.Group
                        as={Col}
                        md="6"
                        controlId="validationCustomUsername"
                      >
                        <Form.Label>
                          Address Line 1<span className="required-span">*</span>
                        </Form.Label>
                        <InputGroup hasValidation>
                          <Form.Control
                            type="text"
                            placeholder="House No., Building, Colony, Area"
                            aria-describedby="inputGroupPrepend"
                            required
                            onChange={(e) => setAddress1(e.target.value)}
                          />
                        </InputGroup>
                      </Form.Group>
                      <Form.Group
                        as={Col}
                        md="6"
                        controlId="validationCustomUsername"
                      >
                        <Form.Label>Address Line 2</Form.Label>
                        <InputGroup hasValidation>
                          <Form.Control
                            type="text"
                            placeholder="Land mark, Near by Places"
                            aria-describedby="inputGroupPrepend"
                            required
                            onChange={(e) => setAddress2(e.target.value)}
                          />
                          <Form.Control.Feedback type="invalid">
                            Please choose a username.
                          </Form.Control.Feedback>
                        </InputGroup>
                      </Form.Group>
                    </Row>
                    <Row className="mb-3">
                      <Form.Group
                        as={Col}
                        md="6"
                        controlId="validationCustom03"
                      >
                        <Form.Label>
                          City<span className="required-span">*</span>
                        </Form.Label>
                        <Form.Control
                          type="text"
                          placeholder="City"
                          required
                          onChange={(e) => setCity(e.target.value)}
                        />
                        <Form.Control.Feedback type="invalid">
                          Please provide a valid city.
                        </Form.Control.Feedback>
                      </Form.Group>
                      <Form.Group
                        as={Col}
                        md="3"
                        controlId="validationCustom04"
                      >
                        <Form.Label>
                          State<span className="required-span">*</span>
                        </Form.Label>
                        <Form.Control
                          type="text"
                          placeholder="State"
                          required
                          onChange={(e) => setState(e.target.value)}
                        />
                        <Form.Control.Feedback type="invalid">
                          Please provide a valid state.
                        </Form.Control.Feedback>
                      </Form.Group>
                      <Form.Group
                        as={Col}
                        md="3"
                        controlId="validationCustom05"
                      >
                        <Form.Label>
                          Zip<span className="required-span">*</span>
                        </Form.Label>
                        <Form.Control
                          type="text"
                          placeholder="Zip"
                          maxLength={6}
                          value={pincode}
                          onChange={(e) => pinValidation(e.target.value)}
                          required
                        />
                        <span className="required-span">{pincodeError}</span>
                      </Form.Group>
                    </Row>
                    <Form.Group className="mb-3">
                      <Form.Check
                        required
                        label="Agree to terms and conditions"
                        feedback="You must agree before submitting."
                        onChange={(e) => setTerms(e.target.value)}
                      />
                    </Form.Group>
                    <Button
                      type="button"
                      onClick={() => handleContinue()}
                      disabled={loading ? "disabled" : ""}
                    >
                      Continue to Store
                    </Button>
                  </Form>
                  {loadingBill ? (
                    ""
                  ) : errorBill.response_code == 0 ? (
                    <p style={{ color: "red", padding: "10px" }}>
                      Something went wrong! Please contact our support team or
                      try again after some times.
                    </p>
                  ) : billingInfo ? (
                    <Navigate to="/register-step-3" />
                  ) : (
                    ""
                  )}
                </Card.Body>
              </Card>
            </Col>
            <Col sm="2"></Col>
          </Row>

          <div className="col-md-6">
            <div className="hero-img" data-appear-fade-in>
